(94620592, 'Lenda dos 7 Mares, Pt. 2', 'https://e-cdns-images.dzcdn.net/images/cover/f9745153378747c85ad8a5a3a4501bc1/250x250-000000-80-0-0.jpg', NULL, 10639133, 85, 'https://api.deezer.com/album/94620592/tracks', 0);
INSERT INTO `ARTISTE` (`idartiste`, `nomartiste`, `bio`, `pays`, `imgartiste`, `mailclient`) VALUES
(26, 'Daniel Balavoine', '\nEmblematic French singer from the 80\'s, Daniel Balavoine (1952-1986) participated in the first Starmania rock-show (later played in the USA as \'Tycoon\') and wrote many popular songs that shook French youth during his time, such as Le Chanteur, L\'Aziza, Sauver l\'amour ... \n\nVery engaged in the civil society, he sang and personified the lust for life, the hopes and the doubts of his generation, often clashing with politicians, elites, and older generations. <a href=\"https://www.last.fm/music/Daniel+Balavoine\">Read more on Last.fm</a>', 'FR', 'https://cdns-images.dzcdn.net/images/artist/f9099e03ef762b2b675136c1d3500a13/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(27, 'Daft Punk', 'Daft Punk  is a multi Grammy Award-winning electronic music duo formed in 1994 in Paris, France, and consisting of French musicians Thomas Bangalter (born 3 January 1975) and Guy-Manuel de Homem-Christo (born 8 February 1974). The band is considered one of the most successful electronic music collaborations of all time, both in album sales and in critical acclaim. \r\n\r\nDaft Punk reached significant popularity in the late 90s house movement in France, along with other artists such as Air, Cassius, and Dimitri From Paris. <a href=\"https://www.last.fm/music/Daft+Punk\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/f2bc007e9133c946ac3c3907ddc5d2ea/250x250-000000-80-0-0.jpg', NULL),
(76, 'Fatboy Slim', 'Fatboy Slim is a pseudonym of Quentin Leo Cook (b. 31 Jul 1963 in Reigate, Surrey - aka Norman Cook), an English big beat musician.\n\nQuentin Leo Cook was educated at Reigate Grammar School. He started a punk fanzine titled Peroxide with his neighbour Andrew Thomas and art student Ian McKay (formerly Laidlaw). Contemporary with his publishing activities, he played drums in Disque Attack (a British new-wave-influenced rock band) for which he later performed lead vocals. <a href=\"https://www.last.fm/music/Fatboy+Slim\">Read more on Last.fm</a>', 'GB', 'https://cdns-images.dzcdn.net/images/artist/8779feed15b09402a4600a2cce8ffabe/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(85, 'The Prodigy', 'The Prodigy are a Braintree, Essex, UK, electronic music group (aka Prodigy), formed by Liam Howlett (composition, keyboards), in 1990. They have sold over 20 million records worldwide, which is almost unequalled in dance music history.\n\nTheir music consists of various styles ranging from rave and breakbeat hardcore in the early 90s to alternative rock and big beat, with punk vocal elements in later times. Other current band members include:  Maxim (MCing <a href=\"https://www.last.fm/music/The+Prodigy\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/4d884e6864623a3446040eaa8e9fb18d/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(115, 'AC/DC', 'AC/DC is an Australian rock band formed in Sydney, New South Wales, Australia in December 1973 by Angus and Malcolm Young. Their albums have sold in colossal numbers; the total is now estimated at well over 200 million copies worldwide, with the 1980 album Back In Black selling over 21 million in the US alone and 40+ million worldwide, making it, according to statistics, one of the best selling albums in the world, outsold only by Michael Jackson\'s \'Thriller\', and tied with Pink Floyd\'s \'Dark Side of the Moon\'. <a href=\"https://www.last.fm/music/AC%2FDC\">Read more on Last.fm</a>', 'AU', 'https://e-cdns-images.dzcdn.net/images/artist/ad61d6e0fa724d880db979c9ac8cc5e3/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(129, 'R.E.M.', '\nR.E.M. was an American rock band from Athens, Georgia, that was formed in 1980 by drummer Bill Berry, guitarist Peter Buck, bassist/backing vocalist Mike Mills, and lead vocalist Michael Stipe. One of the first alternative rock bands, R.E.M. was noted for Buck\'s ringing, arpeggiated guitar style, Stipe\'s distinctive vocal quality and obscure lyrics, Mills\' melodic basslines and backing vocals, and Berry\'s tight, economical style of drumming. R.E. <a href=\"https://www.last.fm/music/R.E.M.\">Read more on Last.fm</a>', 'US', 'https://cdns-images.dzcdn.net/images/artist/ca8391742233c9818cd1dafa523c8dca/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(145, 'Beyoncé', '\nBeyoncé (born Beyoncé Giselle Knowles, September 4, 1981) is an American pop/RnB singer, songwriter, record producer, actress and model. She is the older sister of RnB singer Solange. Beyoncé was named Billboard\'s Top Female Artist of the 2000s in February 2009 as well as their Artist of the Millennium in May 2011. She was the RIAA\'s top certified and best-selling overall artist of the decade and the NRJ Music Awards also awarded her as their Artist of the Decade in France. <a href=\"https://www.last.fm/music/+noredirect/Beyonc%C3%A9\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/c2758d701859526e70acc0cc6a8a18a1/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(160, 'Shakira', 'Little known outside her native Colombia, it wasn\'t until 1995 when Shakira took full creative control over her music, a fusion of rock and dance pop with both deeply personal and biting political lyrics. The approach yielded two multiplatinum albums. In 2001, she broke through into the English-speaking market with the release of her first album in that language, Laundry Service, which she wrote and produced herself and which has sold 3,5 million copies in the United States and 15 million (sometimes stated as 20 million) copies worldwide. <a href=\"https://www.last.fm/music/Shakira\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/866b0be8692efb8619b8f2177511de46/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(176, 'Dire Straits', '\nDire Straits were a British rock band from Newcastle, United Kingdom,  formed in 1977 by Mark Knopfler (guitar and vocals), his brother David Knopfler (guitar), John Illsley (bass), and Pick Withers (drums), and subsequently managed by Ed Bicknell. The band were inducted into the Rock and Roll Hall of Fame in 2018.\n\nDire Straits emerged during the post-punk era of the late \'70s, and while their sound was minimalistic and stripped down, they owed little to punk. <a href=\"https://www.last.fm/music/Dire+Straits\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/ac0c476768de3e1b8dd66dfd33a43278/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(182, 'Red Hot Chili Peppers', NULL, 'US', 'https://e-cdns-images.dzcdn.net/images/artist/8f9531ea8dc34b2fb80a97520a12f2a3/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(198, 'Céline Dion', 'Céline Marie Claudette Dion (born March 30, 1968 in Charlemagne, Quebec, Canada) is a Canadian singer. Regarded as one of pop music\'s most influential voices, Céline Dion remains the best-selling Canadian artist and one of the best-selling artists of all time with record sales of over 200 million copies worldwide.  To date, Céline Dion has won five Grammy Awards, including Album of the Year and Record of the Year.  She is the second best-selling female artist in the US during the Nielsen SoundScan era. <a href=\"https://www.last.fm/music/+noredirect/C%C3%A9line+Dion\">Read more on Last.fm</a>', 'CA', 'https://e-cdns-images.dzcdn.net/images/artist/4896f687b2aff95b87ce5e774dab8bc6/250x250-000000-80-0-0.jpg', NULL),
(216, 'Wham!', 'Wham! (often written WHAM!) was a pop band formed in 1981 from Bushey, England. They were briefly known in the United States as Wham! UK due to a naming conflict with another band.\n\nGeorge Michael and Andrew Ridgeley met at Bushey Meads School in Watford, England. At first, they performed in a short-lived rock and roll band called The Executive. They then changed their name and signed with Innervision Records. Soon after a legal victory over Innervision <a href=\"https://www.last.fm/music/Wham%21\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/c0e223efe2b63d138dae7f21288f5514/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(412, 'Queen', '\nQueen were an English rock band originally consisting of four members: vocalist and pianist Freddie Mercury, guitarist Brian May, bass guitarist John Deacon, and drummer Roger Taylor.\n\nThe band formed in London in 1970 after May and Taylor\'s former band Smile split after having released an album and single. Freddie replaced lead vocalist Tim Staffell, after the latter\'s departure from the original trio. \n\nThere was much deliberation as to what the band\'s name would be. <a href=\"https://www.last.fm/music/Queen\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/194b1c0a1a49a56ec00024c78e178536/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(458, 'System of a Down', 'System of a Down is an Armenian American alternative metal band, formed in 1994 in Los Angeles, California, USA. All four members are of Armenian descent, and are widely known for their outspoken views expressed in many of their songs confronting the Armenian Genocide of 1915 by the Ottoman Empire and the ongoing War on Terror by the US government. The band consists of Serj Tankian (vocals), Daron Malakian (vocals, guitar), Shavo Odadjian (bass, vocals) and John Dolmayan (drums). <a href=\"https://www.last.fm/music/System+of+a+Down\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/67460cdb0b52bfde1b807650958058d6/250x250-000000-80-0-0.jpg', NULL),
(465, 'Mario', 'Mario Dewar Barrett (born August 27, 1986 in Baltimore, Maryland) is a Grammy nominated R&B singer, dancer, model and actor signed to J Records. He released his self-titled debut album in 2002 to critical and commercial success, with it selling over 96,000 copies in its first week. In 2004, he released his second album Turning Point, and had huge success with the song \"Let Me Love You\". It was one of the biggest songs of the year, holding a nine week run at #1 on the Billboard Hot 100. <a href=\"https://www.last.fm/music/Mario\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/d1be58541949168b996f7f886f4fca50/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(517, 'Alan Jackson', 'Alan Eugene Jackson (born October 17, 1958) is an American country music singer, known for blending traditional honky tonk and mainstream country sounds and penning many of his own hits. He has recorded 14 studio albums, three Greatest Hits albums, two Christmas albums, one Gospel album and several compilations, all on the Arista Nashville label. More than 50 of his singles have appeared on Billboard\'s list of the \"Top 30 Country Songs\". Of Jackson\'s entries, 35 were number-one hits, with 50 in the Top 10. <a href=\"https://www.last.fm/music/Alan+Jackson\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/7440703c81254acad12f1ebead8284de/250x250-000000-80-0-0.jpg', NULL),
(663, 'Guns N\' Roses', 'Guns N\' Roses is an American hard rock band founded in Los Angeles, California in 1985. \n\nThe band has released six studio albums: Appetite For Destruction in 1987, G N\' R Lies in 1988, Use Your Illusion I and Use Your Illusion II in 1991, \"The Spaghetti Incident?\" in 1993 and, after 15 years and with frontman Axl Rose and keyboardist Dizzy Reed being being the only members left from the previous lineup, Chinese Democracy in 2008. They also released three EP\'s in 1986, 1988, and 1993 and two live albums, in 1999 and 2014. <a href=\"https://www.last.fm/music/Guns+N%27+Roses\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/e6702c9959070481a1ae9a5c2fb7bb2b/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(671, 'Georges Brassens', 'Georges Brassens was a French singer-songwriter known for accompanying himself with his acoustic guitar. He wrote some extremely controversial, yet poetic songs.  In doing so, he managed to change attitudes across France.\n\nHe was uncompromising when composing his songs.  His tactical method of addressing issues was profound and often humorous, making him a unique and effective figure in the French community.\n\nBrassens, born in 1921 in the small Mediterrenean port of Sete, wanted to be a poet. <a href=\"https://www.last.fm/music/Georges+Brassens\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/c1d1e7f0defadb4566e59e8f19fcd45e/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(791, 'Alan Silvestri', 'Alan Anthony Silvestri (born March 26, 1950) is an American composer and conductor who works primarily in film and television. He is best known for his frequent collaboration with director Robert Zemeckis, including composing major hit films such as the Back to the Future trilogy and Forrest Gump, as well as the superhero films Captain America: The First Avenger and Marvel\'s The Avengers.\n\nSilvestri grew up in Teaneck, New Jersey and attended Teaneck High School. He went to Berklee College of Music for 2 years and is of Italian descent. <a href=\"https://www.last.fm/music/Alan+Silvestri\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/5b595b30a414979ee7259b88384fc65c/250x250-000000-80-0-0.jpg', 'adrien.lascombes@gmail.com'),
(809, 'Compay Segundo', 'Máximo Francisco Repilado Muñoz. (*Siboney, 18 de noviembre de 1907 - † La Habana, 14 de julio de 2003). Fue músico y compositor cubano de amplia trayectoria mundial.\n\nLlegó a ser un popular compositor e intérprete, muy conocido entre los amantes de la música cubana. Comenzó tocando la guitarra, el clarinete y el bongó. Fue el inventor del armónico, un instrumento de siete cuerdas, entre la guitarra española y el tres cubano. También tocó la tumbadora. <a href=\"https://www.last.fm/music/Compay+Segundo\">Read more on Last.fm</a>', 'CU', 'https://e-cdns-images.dzcdn.net/images/artist/de76cb6460fc197acccddea37bd82a1e/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(823, 'Ozzy Osbourne', 'John Michael \"Ozzy\" Osbourne (born 3 December 1948) is an English singer, songwriter and actor. He rose to prominence in the early 1970s as the lead vocalist of the heavy metal band Black Sabbath. He was fired from Black Sabbath in 1979 and went on to have a successful solo career, releasing 11 studio albums, the first seven of which were all awarded multi-platinum certifications in the US. Osbourne has since reunited with Black Sabbath on several occasions, recording the album 13 in 2013. <a href=\"https://www.last.fm/music/Ozzy+Osbourne\">Read more on Last.fm</a>', 'US', 'https://cdns-images.dzcdn.net/images/artist/4a2427697118be4e675e6c788ac5d92b/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(912, 'Apocalyptica', 'Apocalyptica is a band from Helsinki, Finland consisting of three classically-trained cellists and a drummer. Their speciality is heavy metal music on cellos, though they also play classical music.\n\nThey started in 1993 by playing covers of Metallica, but once the concept became popular they wrote their own original works, maintaining the thrash metal influences on their albums Inquisition Symphony (mainly covers as well) and Cult. Since Reflections they have added drums to their recordings and live performances. <a href=\"https://www.last.fm/music/Apocalyptica\">Read more on Last.fm</a>', 'FI', 'https://e-cdns-images.dzcdn.net/images/artist/9ea2d1f9b5285683f6acb4fc3844a628/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(1125, 'Elvis Presley', 'Elvis Aaron Presley[a] (January 8, 1935 – August 16, 1977) was an American singer and actor. Regarded as one of the most significant cultural icons of the 20th century, he is often referred to as the \"King of Rock and Roll\" or simply \"the King\".\n\nPresley was born in Tupelo, Mississippi, and relocated to Memphis, Tennessee, with his family when he was 13 years old. His music career began there in 1954, recording at Sun Records with producer Sam Phillips, who wanted to bring the sound of African American music to a wider audience. <a href=\"https://www.last.fm/music/Elvis+Presley\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/935d35a45e061e7640a0becfa42cef6e/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1311, 'Dominique A', '\nBorn on the 6 October 1968 in Provins, France, Dominique Ané is the only child of a teacher and a homemaker.  A loner throughout his teenage years, he was passionate about literature and music from a young age.  He was interested in punk but, at the age of 14, at the beginning of the 1980s, he started to appreciate the dark romanticism of the New Wave movement.  After completing high school he studied humanities for a year while holding a range of odd jobs <a href=\"https://www.last.fm/music/Dominique+A\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/3084390eac1093b65bf58e9d8088175b/250x250-000000-80-0-0.jpg', 't@'),
(1453, 'DJ BoBo', 'René Baumann (born January 5, 1968 in Kölliken, Switzerland, to Italian father Luigi Cipiriano and Swiss mother Ruth Baumann) also known as DJ BoBo, is a successful eurodance musician.\n\nAs a dance music producer, his first big success came with the single Somebody Dance with Me, which is similar in sound to Rockwell\'s, \"Somebody\'s Watching Me\". The single hit number one in Switzerland. After this, he charted well with the singles Keep on Dancing and Take Control. <a href=\"https://www.last.fm/music/DJ+Bobo\">Read more on Last.fm</a>', 'DE', 'https://e-cdns-images.dzcdn.net/images/artist/0256e6ba0a473ede653b37d73d4b4177/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(1501, 'Arthur H', NULL, 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/88ee2e9e14831e0c757682a3db35fd3e/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1560, 'Jacques Brel', 'Jacques Brel (8 April 1929 – 9 October 1978) was a Belgian singer and songwriter who composed and performed literate, thoughtful, and theatrical songs that generated a large, devoted following in Belgium and France initially, and later throughout the world. He was widely considered a master of the modern chanson. Although he recorded most of his songs in French, he became a major influence on English-speaking songwriters and performers such as David Bowie, Alex Harvey, Leonard Cohen, Marc Almond and Rod McKuen. <a href=\"https://www.last.fm/music/Jacques+Brel\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/3369b8c95a537fc09dbff822ff1bfd0e/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1626, 'Léo Ferré', 'Léo Ferré (1916-1993) was a Monegasque poet, composer, and, musician.\n\nBorn on the 24th August 1916 in Monaco, Ferré mixed lyricism with slang; love with anarchy. He took a central place in the world of French song. He was involved in anarchism, and worked with Radio Libertaire, an anarchist free-radio broadcasting in Paris and around France.  He died on the 14th July 1993.\n\n*Official site <a href=\"https://www.last.fm/music/+noredirect/L%C3%A9o+Ferr%C3%A9\">Read more on Last.fm</a>', 'NL', 'https://e-cdns-images.dzcdn.net/images/artist/4a0a17844ef58c64da7ac60c83148df0/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(2111, 'Billy Idol', 'Billy Idol (born William Michael Albert Broad on November 30, 1955 in Middlesex, England) is an English musician. Idol lived in Worthing before attending Sussex University for only a year before joining the Bromley Contingent of keen Sex Pistols fans. During this period, Idol decided to become a musician and formed a band called Generation X in 1976.\n\nGeneration X signed to Chrysalis Records and released three successful albums before breaking up. <a href=\"https://www.last.fm/music/Billy+Idol\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/c5ba9ee2f7818f1cdbb55a0d0ad82b92/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(2318, 'Etienne de Crécy', 'Etienne de Crécy (also known as Superdiscount, Minos Pour Main Basse, and Mooloodjee) is a French DJ and producer who composes House music. He was born in Lyon in 1969, and attended in the same college as Air and Alex Gopher, with whom he created the Solid label. Then, he worked in Paris as a sound engineer where he met Cassius, with whom he worked on the Motorbass album, a preview of what would be his second album: Super Discount, released in 1996, with Air, Alex Gopher and other French artists on Solid. <a href=\"https://www.last.fm/music/+noredirect/Etienne+de+Cr%C3%A9cy\">Read more on Last.fm</a>', 'FR', 'https://cdns-images.dzcdn.net/images/artist/5de31e0949b00d2016c8e4a514c7e4ec/250x250-000000-80-0-0.jpg', NULL),
(2483, 'The Black Keys', 'The Black Keys are a two-man blues-rock group from Akron, Ohio, United States which formed in 2001, consisting of singer and guitarist Dan Auerbach and drummer Patrick Carney. The band name was inspired by a schizophrenic artist and friend in Akron, who used the term \"black keys\" to describe things he disliked or people he did not trust. The Black Keys have roots in traditional blues and psychedelic rock stylings.\n\nThey released their first album, The Big Come Up, in 2002, followed by Thickfreakness in 2003, and Rubber Factory in 2004. <a href=\"https://www.last.fm/music/The+Black+Keys\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/3d859e837f03daa150dda9110c818af0/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(2489, 'New Radicals', 'The New Radicals were an alternative rock/power pop band that formed in Los Angeles, California in 1997, being centered around front-man Gregg Alexander, who wrote and produced all of their songs. They released only one album, 1998\'s \'Maybe You\'ve Been Brainwashed Too\', a critically acclaimed pop rock album heavily influenced by classic  rock and soul of the 60s and 70s that contained— amongst radio-friendly pop tracks and love songs— strong criticism of corporate America and modern culture. <a href=\"https://www.last.fm/music/New+Radicals\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/e78d65ce36c1443ac358038337d63807/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(2575, 'David Hasselhoff', NULL, 'DE', 'https://e-cdns-images.dzcdn.net/images/artist/d7592dd4e198876e7c15ef048ba93c1d/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(2587, 'Louis Jordan', 'Louis Jordan (July 8, 1908 - February 4, 1975) was a pioneering African-American jazz and rhythm & blues musician and songwriter who enjoyed his greatest popularity from the late 1930s to the early 1950s. Known as \"The King of the Jukebox\", Jordan was highly popular with both black and white audiences in the later years of the swing era.\n\nJordan was one of the first black recording artists whose popularity crossed over into the mainstream white audience and who scored hits on both the \"race\" charts and the mainstream white pop charts. <a href=\"https://www.last.fm/music/Louis+Jordan\">Read more on Last.fm</a>', 'QM', 'https://e-cdns-images.dzcdn.net/images/artist/af80c79e6dce180e14a6be96ae6ed346/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(2799, 'Buena Vista Social Club', 'Buena Vista Social Club is an ensemble of Cuban musicians established in 1996 to revive the music of pre-revolutionary Cuba. The project was organized by World Circuit executive Nick Gold, produced by American guitarist Ry Cooder and directed by Juan de Marcos González. They named the group after the homonymous members\' club in the Buenavista quarter of Havana, a popular music venue in the 1940s. To showcase the popular styles of the time, such as son <a href=\"https://www.last.fm/music/Buena+Vista+Social+Club\">Read more on Last.fm</a>', 'CU', 'https://e-cdns-images.dzcdn.net/images/artist/1f40462e4b7cf34267fdae760a8d7299/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(2833, 'Chuck Berry', '\nCharles Edward Anderson \"Chuck\" Berry (October 18, 1926 – March 18, 2017) was an American guitarist, singer and songwriter and is one of the pioneers of rock and roll music.\n\nChuck Berry remains an influential figure and one of the pioneers of rock and roll music who first began performing in 1953.  Cub Koda wrote, \"Of all the early breakthrough rock & roll artists, none is more important to the development of the music than Chuck Berry. He is its greatest songwriter <a href=\"https://www.last.fm/music/Chuck+Berry\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/b569def91361aaaea6be30c038955b60/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(2912, 'Alan Menken', 'Alan Menken (born July 22, 1949 in New Rochelle, New York, United States) is an American musical theatre and film composer, and pianist. Menken has collaborated with several renowned lyricists including Howard Ashman (1950-1991), Tim Rice and Stephen Schwartz. For his work he has won eight Academy Awards as well as ten additional nominations.\nHis best known work includes the Disney animated movies, The Little Mermaid, Beauty and the Beast, Aladdin <a href=\"https://www.last.fm/music/Alan+Menken\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/3061b110a8d59aee23e458dc8636eb12/250x250-000000-80-0-0.jpg', 'adrien.lascombes@gmail.com'),
(3106, 'a-ha', 'a-ha are a Norwegian new wave band. The trio, composed of lead vocalist Morten Harket, guitarist Paul Waaktaar-Savoy and keyboardist Magne Furuholmen, formed in 1982 and left Oslo, Norway for London in order to make a career in the music business. \n\nThe origin of the name a-ha comes from the lyric of an early song. After checking dictionaries in several languages, they found out that \'a-ha\' was an international way of expressing recognition, with positive connotations. It was short, a-ha was easy to say and somewhat unusual. <a href=\"https://www.last.fm/music/a-ha\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/e75011f0a976ec656ad6c198a49e8c5b/250x250-000000-80-0-0.jpg', 't@'),
(3580, 'Anthrax', '1) Anthrax are an American, New York City-based thrash metal band, who released their first full-length album in 1984. The band was one of the most popular bands of the 80s thrash metal scene and are notable for combining metal with rap and hardcore music early on. The band has sold over 10 million albums worldwide, and are classified as one of the \'\'big four\'\' of thrash metal bands alongside Metallica, Slayer, and Megadeth. Anthrax were formed in 1981 by guitarists Scott Ian and bassist Danny Lilker. <a href=\"https://www.last.fm/music/Anthrax\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/780fc97addac9f6b7a6d601d0f6d2217/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(3771, 'Mr. Oizo', 'Mr. Oizo (pronounced in French \'Monsieur Oiseau\' / məsjø wazo) is the nom de plume for French record producer Quentin Dupieux (kɑ̃tɛ̃ dypjø).\n\nDupieux is most famous for his electro track \"Flat Beat\", which became a hit all across Europe in 1999 for being featured in a series of Levi\'s jeans TV advertisements. Dupieux also directed the ad, which featured a yellow puppet named Flat Eric nodding his head to the sound of the track while riding in a pickup truck. Flat Eric later appeared in the music video for \"Flat Beat\". <a href=\"https://www.last.fm/music/Mr.+Oizo\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/589305cb56ea3555b1f94341955bf875/250x250-000000-80-0-0.jpg', NULL),
(4237, 'Little Richard', 'Little Richard (born Richard Wayne Penniman, December 5, 1932 in Macon, Georgia, United States) is an American singer, songwriter, and pianist, and an early pioneer of rock \'n\' roll, influencing generations of R&B and rock artists. Many of his fans have proclaimed Richard as The Real King of Rock \'n\' Roll (in reference to the deceased Elvis Presley, who\'s known by the moniker \"The King of Rock \'n\' Roll\"). He has also been called the King of Rockin \'n\' Rollin, Rhythm & Blues Soulin\'. <a href=\"https://www.last.fm/music/Little+Richard\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/30bf4af9c7f3b732c7e55b08ae5b2ee8/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(5189, 'Alan Stivell', 'Alan Stivell (born Alan Cochevelou January 6, 1944) is a world-renowned Breton musician, singer, recording artist and master of the Celtic harp.  From the early 1970s Stivell revived global interest in the Celtic (specifically Breton) harp and Celtic music as part of world music.\n\nStivell was born in the Auvergnat town of Riom, France, and specialises in traditional Breton and Celtic music. He also plays instruments such as the bombarde, biniou, flute, etc. <a href=\"https://www.last.fm/music/Alan+Stivell\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/8b0953ba4afbeb517cddfe43d43f5821/250x250-000000-80-0-0.jpg', 'adrien.lascombes@gmail.com'),
(5632, 'Olivia Newton-John', 'Born in Cambridge, England in 1948, the youngest child of Professor Brin Newton-John and Irene, daughter of Nobel Prize winning physicist, Max Born, Olivia moved to Melbourne, Australia with her family when she was five. By the age of fifteen, she had formed an all-girl group called Sol Four. Later that year she won a talent contest on the popular TV show, “Sing, Sing, Sing,” which earned her a trip to London. By 1963, Olivia was appearing on local daytime TV shows and weekly pop music programs in Australia. <a href=\"https://www.last.fm/music/Olivia+Newton-John\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/70ea10b4ac98259a2207f52d89237d5d/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(5856, 'B.J. Thomas', 'Billy Joe \"B.J.\" Thomas (born August 7, 1942) is an American popular singer. He is particularly known for his hit songs of the 1960s and 1970s, which appeared on the pop, country, and Christian music charts. His best-known recording is the Burt Bacharach/Hal David song \"Raindrops Keep Fallin\' on My Head\".\n\nThomas was raised in and around Houston, Texas, graduating from Lamar Consolidated High School in Rosenberg. Before his solo career, he sang in a church choir as a teenager, then joined the musical group The Triumphs. <a href=\"https://www.last.fm/music/B.J.+Thomas\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(6404, 'Justice', ' Justice is an electronic music duo from Paris, France, formed in 2003 and consisting of Gaspard Augé (born 21 May, 1979) and Xavier de Rosnay  (born 2 July, 1982). They are mostly known for their remix of Simian’s “Never Be Alone”, later renamed “We Are Your Friends”, as well as their “Waters of Nazareth” EP and their single release of ‘’D.A.N.C.E.’‘. Their debut album is entitled “†” but is often spelled out “Cross”. <a href=\"https://www.last.fm/music/Justice\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/46773214a3a3e074822aa2c5b489619d/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(6456, 'Behemoth', 'There are multiple artists with this name:\n\n1) Behemoth is a Polish blackened death metal band from Gdańsk. They are considered to have played an important role in establishing the Polish extreme metal underground, alongside bands such as Vader, Decapitated, Vesania and Hate. Over the years, Behemoth moved from traditional black metal into death metal, and have since perched in the middle of the two. They have released 11 full-length albums so far. <a href=\"https://www.last.fm/music/Behemoth\">Read more on Last.fm</a>', 'SE', 'https://e-cdns-images.dzcdn.net/images/artist/3f100d099c0ed7bcbc6807ca4407ee0a/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(7048, 'Swing Out Sister', 'Swing Out Sister are a British pop musical group best known worldwide for their 1986 hit single Breakout.\n\nThe group presently comprises Andy Connell (born Andrew John Connell, Jul 26, 1961, Nottingham; keyboards) and Corinne Drewery (born Sep 21, 1959, Nottingham; vocals), though it began as a trio in the United Kingdom. The group was initially formed by Connell and Martin Jackson (drums), in 1985 who were later joined by Drewery. The group\'s name came from a 1945 movie called Swing Out <a href=\"https://www.last.fm/music/Swing+Out+Sister\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/9218285812cf2d1ad1ca8d54eb9f0b67/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(7278, 'Electric Wizard', 'Electric Wizard are a band from Dorset, UK. They have a distinct, yet traditional doom metal sound that incorporates stoner and sludge traits, with lyrics typically involving the occult, witchcraft, H.P. Lovecraft, horror films and marijuana. During 2003, founding members Tim Bagshaw and Mark Greening left to form the band Ramesses, leaving guitarist/vocalist Jus Oborn the only remaining founding member.\n\nThe oblivion and ecstasy of crushing doom and high grade marijuana <a href=\"https://www.last.fm/music/Electric+Wizard\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/1be70eb1c35425c28ba9c703105ac2fa/250x250-000000-80-0-0.jpg', NULL),
(7306, 'Count Basie', 'William \"Count\" Basie (August 21, 1904– April 26, 1984) was a jazz pianist, organist, composer, and bandleader.\n\nAs a pianist, he had a distinctive and influential style (the song title \"Splanky\" is an onomatopoetic reference to the sound of his playing), equally at home in the barrelhouse and the concert hall. Willie \"The Lion\" Smith, James P. Johnson, and Fats Waller were among his influences.\n\nAs a bandleader, he created an organization (built <a href=\"https://www.last.fm/music/Count+Basie\">Read more on Last.fm</a>', 'DE', 'https://e-cdns-images.dzcdn.net/images/artist/424861d3de8f86e7c0fb4a5d263036c0/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(7343, 'Carlos Vives', 'Before he graduated from Jorge Tadeo Lozano\'s University with a publicist degree, singer/songwriter Carlos Vives joined different bands and participated in several plays. In 1982, the artist got a role in the Colombian TV series Tiempo Sin Huella, starting his successful acting career, later extending his professional skills to the Puerto Rican television.\n\nAfter participating in some teen programs as a singer/actor, he got the main role in the telenovela (soap opera) \"Gallito Ramírez,\" which made him a famous actor. <a href=\"https://www.last.fm/music/Carlos+Vives\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/281c7f9ed571d5df9c338b8e7eeeba68/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(7613, 'Roberto Carlos', 'Roberto Carlos (born April 19, 1941 in Cachoeiro de Itapemirim, Espírito Santo, Brazil) initiated a major revolution of customs in Brazil in the \'60s. Reaching success in a period coinciding with the youth movement started by the The Beatles that was taking over the world, Carlos was the leader of Jovem Guarda (\"Young Guard\") . He led the TV show that became a generic denomination of a musical style and what was a definitive change of face to the <a href=\"https://www.last.fm/music/Roberto+Carlos\">Read more on Last.fm</a>', 'BR', 'https://e-cdns-images.dzcdn.net/images/artist/2a418ab6e0c357bfd680d3f35b45d8ea/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(7851, 'Screamin\' Jay Hawkins', NULL, 'US', 'https://cdns-images.dzcdn.net/images/artist/7248b04977679f75b6a65cb89c86c437/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(7886, 'Class A', '1. Class A is a brazilian rap group. \n\n2. Class A is a female MC based in Geelong/Melbourne Australia.\n\n3. Class A is an alias used by house music producers Paul Emanuel and Jeremy Sylvester. \n\nhttp://www.discogs.com/artist/Class+A <a href=\"https://www.last.fm/music/Class+A\">Read more on Last.fm</a>', 'BX', 'https://e-cdns-images.dzcdn.net/images/artist/5b7edf6edcb2325e6c629004103aef1f/250x250-000000-80-0-0.jpg', NULL),
(8691, 'Charlie Brown Jr.', 'Charlie Brown Jr. was a brazilian skate rock band, from the city of Santos, São Paulo, whose main influences were Sublime, Rancid, Bad Brains, 311, Blink 182,  Suicidal Tendencies, Infectious Grooves and Beastie Boys. The songs of the band blended various musical genres such as melodic hardcore, ska, rap, alternative rock and skate punk, creating a unique and original style.\n\nHistory\n\nWhen Chorão came to Santos at seventeen (after a difficult and somewhat traumatic childhood) he already had a strong interest in skateboarding and rock music. <a href=\"https://www.last.fm/music/Charlie+Brown+JR.\">Read more on Last.fm</a>', 'BR', 'https://e-cdns-images.dzcdn.net/images/artist/b92cff7f238475dfbee8d458cbe09b84/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(8762, 'Georges Bizet', 'Georges Bizet (1838–1875) was a French composer and pianist of the romantic era.\n\nBizet was born on 25th October 1838 in Paris. He was registered with the legal name Alexandre-César-Léopold Bizet, but was baptised Georges Bizet and was always known by the latter name. A child prodigy, he entered the prestigious Paris Conservatory of Music a fortnight before his tenth birthday.\n\nIn 1857 he shared a prize offered by Jacques Offenbach for a setting of the one-act operetta Le docteur Miracle, and won the Prix de Rome. <a href=\"https://www.last.fm/music/Georges+Bizet\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(9083, 'The Fratellis', 'The Fratellis are an alternative rock band from Glasgow, Scotland who took their name from the villains in the film \"The Goonies\" (although, by coincidence, Barry\'s mother\'s maiden name is in fact Fratelli). The band consisted of lead vocalist and guitarist Jon Fratelli (real name John Lawler), bass guitarist Barry Fratelli (real name Barry Wallace), and drummer, backing vocalist, occasional guitarist and banjo player Mince Fratelli (real name Gordon McRory). <a href=\"https://www.last.fm/music/The+Fratellis\">Read more on Last.fm</a>', 'GB', 'https://cdns-images.dzcdn.net/images/artist/97de8c55a964a7a8d54fdbdef37c4806/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(9202, 'Ken Ishii', 'Ken Ishii (ケンイシイ) is a successful techno DJ and producer from Tokyo. He has released work under his own name as well as under the pseudonyms: FLR, Flare, UTU, Yoga, and Rising Sun.\n\nKen Ishii debuted on a legendary Belgian techno label, R & S Records, in 1993. In that year he straight won No.1 on the UK’s NME magazine’s techno chart, which led him to worldwide recognition. In 1995, the highly praised album “Jelly Tones” (R & S / Sony Japan) was released. <a href=\"https://www.last.fm/music/Ken+Ishii\">Read more on Last.fm</a>', 'JP', 'https://cdns-images.dzcdn.net/images/artist/901ad8c38417222caae1ab03f5af51b2/250x250-000000-80-0-0.jpg', NULL),
(11125, 'Pokémon', 'Pokémon isn\'t a valid artist tag.\nYou may find the correct artists and track listing on this webpage: http://vgmdb.net/, if it is related to the videogames, or either http://www.pocketmonsters.net/cddvd.php?action=cd if it is related to the animation.\n \nPlease do yourself (and last.fm) a favor and fix your tags. <a href=\"https://www.last.fm/music/+noredirect/Pok%C3%A9mon\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/fb3a41cb36290985fbbd86ad11a2bcc5/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(13501, 'L\'Algérino', ' <a href=\"https://www.last.fm/music/L%27Alg%C3%A9rino\">Read more on Last.fm</a>', 'FR', 'https://cdns-images.dzcdn.net/images/artist/3dae7c432e915c64b10f137963822450/250x250-000000-80-0-0.jpg', NULL),
(14373, 'Bernard Minet', 'Bernard Minet (born December 28, 1953) is a French pop singer who especially known for making french song for  Japanese anime soundtrack  . He\'s also the drummer of the comedic band Les Musclés. <a href=\"https://www.last.fm/music/Bernard+Minet\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/341c3f293b8f24919afc27c599ebdb51/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(14388, 'Dorothée', 'Frédérique Hoschédé (born on 14 July 1953 in Paris, France), known as Dorothée, is a French singer and actress.\nShe started her TV career in the Dorothée et Blablatus show.\nShe also had a brief cinema career, playing in 1978 in L\'amour en fuite, François Truffaut\'s last film in the Antoine Doinel series, and in 1981 in Pile ou face by Robert Enrico.\nFrom 1982 to 1987, she presented the Récré A2 TV show on Antenne 2, then the Club Dorothée show (TF1) until 1997.\nDorothée also had a career as a singer. <a href=\"https://www.last.fm/music/+noredirect/Doroth%C3%A9e\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/4280d3fee65fe26b85d50bc0a8deb535/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(16535, 'Screaming Trees', 'There are two bands with the name Screaming Trees:\n\n1. Screaming Trees were a grunge band formed in Ellensburg, Washington in 1985. Their sound was a mix of 60\'s psychedelia and punk rock, and even though they were critically acclaimed by many (and rather succesful in the 1990s_ they never achieved the superstardom of their \'grunge\' peers. Following the Dust Tour, Screaming Trees took another hiatus and after a June 25th 2000 concert to celebrate the opening Seattle\'s Experience Music Project <a href=\"https://www.last.fm/music/Screaming+Trees\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/89c5c244538ac908105e5a1aca08fbfe/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(57518, 'Charlie Barnet', 'Charlie Barnet (October 26, 1913 - September 4, 1991) was unusual in several ways. One of the few jazzmen to be born a millionaire, Barnet was a bit of a playboy throughout his life, ending up with a countless number of ex-wives and anecdotes. He was one of the few white big band leaders of the swing era to openly embrace the music of Duke Ellington (he also greatly admired Count Basie). Barnet was a pioneer in leading integrated bands (as early as 1935). <a href=\"https://www.last.fm/music/Charlie+Barnet\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/daf77c65009dfa8d441cf6c93f2a3d87/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(71813, 'Juan Gabriel', 'Juan Gabriel (Alberto Aguilera Valadez, January 7, 1950 – August 28, 2016) was a Mexican singer and songwriter. Also called El Divo de Juárez, Gabriel was known for his flamboyant style and broke barriers within the Latin music market.\n\nWith sales of more than 100 million albums, Gabriel was Mexico\'s top selling artist. Gabriel\'s album, Recuerdos, Vol. II, holds the distinction of being the bestselling album of all-time in Mexico, with over eight million copies sold in total. During his career he wrote around 1,800 songs. <a href=\"https://www.last.fm/music/Juan+Gabriel\">Read more on Last.fm</a>', 'MX', 'https://e-cdns-images.dzcdn.net/images/artist/960c0d7043d8337b497c724025e4beff/250x250-000000-80-0-0.jpg', NULL),
(72853, 'Preservation Hall Jazz Band', NULL, 'US', 'https://e-cdns-images.dzcdn.net/images/artist/a12ebe2877857c4415dda9fa55b6421d/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(82273, 'Slim Gaillard', 'Bulee \"Slim\" Gaillard (January 4, 1911 or 1916 – February 26, 1991) was an American jazz singer, songwriter, pianist, and guitarist, noted for his scat singing and word play.\n\nDespite record company publicity accounts that Gaillard was born in Santa Clara, Cuba of a Greek father and an Afro-Cuban mother, he was born in Pensacola, Florida to a german immigrant named Theopolous Rothschild and an African-American woman named Liza Gaillard. He grew up in Detroit and moved to New York City in the 1930s. <a href=\"https://www.last.fm/music/Slim+Gaillard\">Read more on Last.fm</a>', 'QM', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(109845, 'The Cats And The Fiddle', 'The Cats And The Fiddle was one of the pre-eminent, pioneering R&B vocal groups of 1930s, and its place in the history of this style is assured.  It was 1937 when the group formed, amalgamating two earlier, separate bands: the \"Harlem Harmony Hounds,\" led by singer Austin Powell, and the aspiring trio of Jimmie Henderson, Chuck Barksdale and Ernie Price.  The latter, Chicago-based group needed a lead singer, and Powell slipped into this role perfectly, so that the initial four-part vocal-instrumental line-up was born. <a href=\"https://www.last.fm/music/The+Cats+and+the+Fiddle\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(124753, 'The Stray Cats', 'The Stray Cats are an American rockabilly band formed in 1979 by guitarist and vocalist Brian Setzer, double bassist Lee Rocker, and drummer Slim Jim Phantom in the Long Island town of Massapequa, New York. \n\nThe group had numerous hit singles in the UK, Australia, Canada and the U.S. including \"Stray Cat Strut\", \"(She\'s) Sexy + 17\", \"Look at That Cadillac,\" \"I Won\'t Stand in Your Way\", \"Bring it Back Again\", and \"Rock This Town\", which the Rock and <a href=\"https://www.last.fm/music/+noredirect/The+Stray+Cats\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(133610, 'Tan Dun', 'Tan Dun (Dun Tan, 譚盾; born August 18, 1957) is best known as the Grammy and Oscar award winning composer for the soundtracks of the movies Crouching Tiger, Hidden Dragon and Hero.\n\nTan Dun was born in the village of Simao, Changsha in the Hunan province of China. As a child, he was fascinated by the role in his village of the shaman, who conducted rituals and ceremonies, often set to music made with organic objects like rocks and water. However <a href=\"https://www.last.fm/music/+noredirect/Tan+Dun\">Read more on Last.fm</a>', 'DE', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', NULL),
(144062, 'Corine', ' <a href=\"https://www.last.fm/music/Corine\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/1d1fa6d18bf2bfa44354753284890774/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(151796, 'Benny Goodman and His Orchestra', NULL, 'US', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(151999, 'Benny Goodman', 'Benny Goodman, born Benjamin David Goodman, (May 30, 1909 – June 13, 1986) was an American jazz musician, known as King of Swing, Patriarch of the Clarinet, The Professor, and Swing\'s Senior Statesman.\n\nGoodman was regarded by some as a demanding taskmaster, by others an arrogant and eccentric martinet. Many musicians spoke of The Ray, Goodman\'s trademark glare that he bestowed on a musician who failed to perform to his demanding standards. Anita O\'Day and Helen Forrest spoke bitterly of their experiences singing with Goodman. <a href=\"https://www.last.fm/music/Benny+Goodman\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/66d16f1c296b912c88beb2d030f92bc2/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(160511, 'Lipps Inc.', 'Lipps Inc. (pronounced like \"lip sync\") was a studio band that achieved one significant hit, \"Funkytown\" in 1980.\n\nThe group was formed in Minneapolis by Steven Greenberg, who wrote and produced all of the group\'s music, and who also played several musical instruments. The lead singer and saxophonist was Cynthia Johnson, and the rest of the group consisted of a changing group of session musicians, including guitarist David Rivkin.\n\nThey achieved some popularity during the late 1970s. <a href=\"https://www.last.fm/music/+noredirect/Lipps+Inc.\">Read more on Last.fm</a>', '', 'https://cdns-images.dzcdn.net/images/artist/848b9e2ae73e76cdcb0354c52681c327/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(181142, 'Al & The Black Cats', ' <a href=\"https://www.last.fm/music/+noredirect/Al+\">Read more on Last.fm</a>', '', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(190148, 'Bruno Spoerri', 'Bruno Spoerri started out playing saxophone in many local jazz groups from duo to big band, arranging and composing for different groups and the Radio Bigband before switching in 1964 to a career as sound recordist and staff composer for a Swiss film production.  \n\nSpoerri has composed film music for feature films, many short films, documentaries and over 500 commercials including embryonic pre-Nintendo sprite-themes for the Germanic equivalents of <a href=\"https://www.last.fm/music/Bruno+Spoerri\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(259767, 'Caravan Palace', 'Paris, France (2005 – present)\n\nIt all started with a double bass player, a guitarist and a violinist; all highly talented musicians who are really into swing, Django addicts who enjoy tinkering with electro. Their project swayed a singer, a clarinettist, a trombonist who doubles up on percussion and a guitarist who also acts as DJ. With their “Zazou” look (inspired by Parisian paleo-punks from the 1940s), they serve up festive, frantic music, an improbable futuristic and melodious Charleston fit for the dance floor. <a href=\"https://www.last.fm/music/Caravan+Palace\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/c5223283e653acd89458c6f3865c5f5f/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com');
INSERT INTO `ARTISTE` (`idartiste`, `nomartiste`, `bio`, `pays`, `imgartiste`, `mailclient`) VALUES
(265914, 'Jay Rock', 'Johnny Reed McKinzie Jr. (born March 31, 1986 in Watts, Los Angeles, California), better known by his stage name Jay Rock, is an American rapper. He was named one of the top 13 most street artists by XXL. His voice has been called a cross between The Notorious B.I.G. and Shyne. He is a part of the rap group Black Hippy which also features Kendrick Lamar, Schoolboy Q and Ab-Soul. Rock signed to Strange Music and released his long-awaited debut studio album Follow Me Home on July 2011. <a href=\"https://www.last.fm/music/Jay+Rock\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/38e6c59b82a5904a5c2f992ac1ec3a08/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(282923, 'Altan Urag', 'Altan Urag is a folk-rock band formed in Mongolia in 2002. The band\'s music fuses traditional Mongolian folk music and sound with contemporary rock music influences.The name Altan Urag (\"Алтан Ураг\" in Mongolian) can be loosely translated as \"Golden Lineage\" or \"Golden Kin\", referring to Chinggis Khan and his ancestors.\nInstruments used in composing and performing the music of Altan Urag include percussion and traditional Mongolian instruments - morin khuur (horse head fiddle) <a href=\"https://www.last.fm/music/Altan+urag\">Read more on Last.fm</a>', 'MN', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(386842, 'Marty Friedman', 'Marty Friedman (born December 8, 1962 in Washington, D.C.) has become recognized worldwide as a guitarist and composer of consummate skill and a style of playing that is instantly recognizable as uniquely his. Marty is a self-taught guitarist famous for his natural improvisation abilities and for pioneering the fusion of exotic Eastern musical scales with Western musical styles such as neo-classical, thrash metal and later on into rock, pop, jazz, metal and anything in between. <a href=\"https://www.last.fm/music/Marty+Friedman\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(487750, 'LeBron', ' <a href=\"https://www.last.fm/music/LeBRON\">Read more on Last.fm</a>', 'QM', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', NULL),
(891364, 'Swing Republic', 'Electro swing projekt with old jazz and a positive vibe. Fito Bolai is the president of Swing Republic. His music is inspired by various cultures. Fito combines the spirituality and emotional expressions from the past with the electronic technology of the future. His music reflects the open-mindedness of hippie culture and hypnotic rhythms of industry. Fito Bolai has a globalized and worldly mindset. \"Emotional Technology\" is one of the leading principles in Fito ́s approach to the musical landscapes and cities of Swing Republic. <a href=\"https://www.last.fm/music/Swing+Republic\">Read more on Last.fm</a>', 'GB', 'https://e-cdns-images.dzcdn.net/images/artist/4f7d90bdd1eaf4009095ad1cc3171a63/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1077715, 'Super Mario Bros', 'Super Mario Bros is a noise/experimental band from Japan.\n\nSuper Mario Bros is also a mistag of 近藤浩治 (Koji Kondo).\n <a href=\"https://www.last.fm/music/Super+Mario+Bros\">Read more on Last.fm</a>', 'DE', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1159033, 'Gordon Webster', 'Pianist Gordon Webster has performed with Wycliffe Gordon, Grant Green Jr., Tim Hagans, Donny McCaslin, Ingrid Jensen, Chris Parker, Steve LaSpina, Jim Rotondi, Adam Nussbaum, Ron McClure, Chris Potter, Joel Frahm, and Jim Black among others.  His playing has been showcased in numerous New York City venues including the Blue Note, The Iridium, Sweet Rhythm, The Cutting Room, Cleopatra\'s Needle, Makor, 92nd Street Y, Mannahatta Lounge, Kavehaz, Triad Theater, Smalls, Cafe Vivaldi, The Bar Next Door, St. <a href=\"https://www.last.fm/music/Gordon+Webster\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1284809, 'Yasunori Mitsuda', 'Yasunori Mitsuda (光田 康典 Mitsuda Yasunori?, born January 21, 1972) is a Japanese video game composer, sound programmer, and musician. He is best known for his work with composing video games such as Chrono Trigger, Chrono Cross, Shadow Hearts, Shadow Hearts: Covenant, Xenogears, Xenosaga Episode I: Der Wille zur Macht, and Mario Party.  He has released an original celtic/vocal album titled Kirite, based on a story written by Masato Kato, writer of Chrono Trigger & Cross. <a href=\"https://www.last.fm/music/+noredirect/Yasunori+Mitsuda\">Read more on Last.fm</a>', 'JP', 'https://cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', NULL),
(1412564, 'Nekfeu', 'Member of the French rap 1995 crew, Nekfeu is know for his freestyle skills many of which are posted on internet. <a href=\"https://www.last.fm/music/Nekfeu\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/38d6e77ea0538b2a3dde1d152974ff0f/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1437941, 'Masahiro Masuda', ' <a href=\"https://www.last.fm/music/Masahiro+Masuda\">Read more on Last.fm</a>', 'JP', 'https://cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(1508312, 'Party Harders vs The Subs', NULL, 'BE', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(1684527, 'Kontra K', 'Kontra K is an underground german rapper. Characterised by his rough voice and realistic lyrics, he defines himself as \"an example but not a role model\".\n\nOnce he was signed on Kaisa\'s Hell Raisa Records. Kontra K and KiezSpezial  released the mixtape \"Fight Club Vol.1\" there in 2008 as Vollkontakt.\n\nFollowing the closure of Hell Raisa Records in 2010, he and his partner Skinny Al (also a former Hell Raisa artist), founded \"DePeKa Records\" where they released „Ein Herz aus Chrom“ EP and Kontra K\'s first solo album „Dobermann“. <a href=\"https://www.last.fm/music/Kontra+K\">Read more on Last.fm</a>', 'DE', 'https://e-cdns-images.dzcdn.net/images/artist/8b8b4e8e2c0ab51feb063ac67b480289/250x250-000000-80-0-0.jpg', NULL),
(3266441, 'Kortez', 'Kortez, właściwie Łukasz Federkiewicz (ur. czerwiec 1989 w Krośnie) – polski muzyk pochodzący z Iwonicza. Jest kompozytorem, wokalistą, gitarzystą, pianistą oraz puzonistą. <a href=\"https://www.last.fm/music/Kortez\">Read more on Last.fm</a>', 'PL', 'https://e-cdns-images.dzcdn.net/images/artist/f401a53edc115621f5e22d4088580b57/250x250-000000-80-0-0.jpg', NULL),
(3638541, 'Mister V', ' <a href=\"https://www.last.fm/music/Mister+V\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/b344b052271779490b7de06297296898/250x250-000000-80-0-0.jpg', 't@'),
(4025984, 'Atoma', 'Atoma started as an underground organisation. A council of 26, financing and sending out its members to join several major riots happening worldwide during 2005–2008.\nAs the organisation was facing severe losses due to its violent nature, it was put \"on hold\" April 2009.\nAt that time, Atoma was also becoming a musical faction as one of its members, Ehsan K. (ex Slumber), began directing a group of dedicated musicians that now bears the name of ATOMA. <a href=\"https://www.last.fm/music/Atoma\">Read more on Last.fm</a>', 'AT', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(4051056, 'Rasmus Lyberth', 'Ramus Lyberth, born in 1951, is one of Greenland\'s most known musicians. He plays the guitar and writes his own music, the lyrics often concerning the development in Greenland, people and nature. He also performes in theatre plays and musicals, has published a poem collection and enjoys carving in soapstone. <a href=\"https://www.last.fm/music/Rasmus+Lyberth\">Read more on Last.fm</a>', 'DK', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(4080791, 'PET CONSPIRACY', '\"We are Pet Conspiracy. We are from China, but we don\'t eat dogs.\" \n\nLead Guitarist Huzi an established artist in the Beijing underground music scene first appeared as the front man for late 90\'s Beijing Alternative Folk Band X-Doctor. Releasing his first album--Dramatic Maquillage for the Night under Jingwen records in 1999. X-Doctor was retired when Huzi started to focus himself on electronica music. Since then, Huzi has released three albums on China\'s most infamous indie label Modern Sky Records <a href=\"https://www.last.fm/music/Pet+Conspiracy\">Read more on Last.fm</a>', 'CH', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', NULL),
(4110152, 'Ben Webster, Bo Stief, Dexter Gordon, Ed Thigpen, ', ' <a href=\"https://www.last.fm/music/Ben+Webster,+Bo+Stief,+Dexter+Gordon,+Ed+Thigpen,+Kenny+Drew\">Read more on Last.fm</a>', '', 'https://cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(4378287, 'Crystal F', ' <a href=\"https://www.last.fm/music/Crystal+F\">Read more on Last.fm</a>', 'DE', 'https://e-cdns-images.dzcdn.net/images/artist/bc54af21829b364b143b7150765210d4/250x250-000000-80-0-0.jpg', 't@'),
(4425846, 'Mambo Kingz', ' <a href=\"https://www.last.fm/music/Mambo+kingz\">Read more on Last.fm</a>', 'TC', 'https://e-cdns-images.dzcdn.net/images/artist/3fef1c768506754f698acdbf9bff9c2d/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(4999707, 'Alan Walker', '\nAlan Walker (born Alan Olav Walker, 24 August 1997 in Northampton, England, United Kingdom) is a British-Norwegian record producer. He recorded electronic dance music single \"Faded\" and his song released on NoCopyrightSounds, \"Fade\". <a href=\"https://www.last.fm/music/Alan+Walker\">Read more on Last.fm</a>', 'NO', 'https://cdns-images.dzcdn.net/images/artist/79d384488d390e65a6c27a95c431627e/250x250-000000-80-0-0.jpg', NULL),
(5951582, 'Jain', ' Jain is a multicultural pop artist influenced by the many places she has called home. Born in Toulouse, France, with roots in Madagascar, she relocated to Dubai at the age of 9 and then onto the Congo during secondary school. This is where she first began experimenting with music under the direction of Mr. Flash. Post graduation she returned to Paris to study the arts. Her music utilises a variety of influences such as, French techno, Arabic percussion, and the rhythms of Africa, to create her unique style.  <a href=\"https://www.last.fm/music/Jain\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist/2fc7da18afbd0e41393c46309aa218f8/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(6517539, 'Axel Foley', 'There is a power violence band called \"Axel Foley\". Don\'t redirect them to \"Harold Faltermeyer\". <a href=\"https://www.last.fm/music/+noredirect/Axel+Foley\">Read more on Last.fm</a>', 'QZ', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(7802522, 'Salut C\'est Cool', ' <a href=\"https://www.last.fm/music/Salut+C%27est+Cool\">Read more on Last.fm</a>', 'FR', 'https://cdns-images.dzcdn.net/images/artist/4f20a4e60d2f7714990f32106c98e401/250x250-000000-80-0-0.jpg', NULL),
(8697922, 'Ruth B.', 'Ruth Berhe (born July 2, 1995), better known by her stage name Ruth B., is a Canadian singer and songwriter from Edmonton, Alberta. She started by singing songs on Vine in early 2013. In November 2015, she released her debut EP, The Intro. On May 5, 2017, she released her first album, Safe Haven. Her single \"Lost Boy\" has accumulated over 300 million streams on Spotify alone as of June 2018, while her YouTube channel has received a total of 138 million views. <a href=\"https://www.last.fm/music/ruth+b.\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/8b4051e40bb1470ee0a5c3a60aca5107/250x250-000000-80-0-0.jpg', NULL),
(9000428, 'Raindrops Sleep', ' <a href=\"https://www.last.fm/music/Raindrops+Sleep\">Read more on Last.fm</a>', 'UK', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(9064930, 'Cardi B', 'Cardi B (born Belcalis Almanzar on 11 October 1992) is an American hip-hop recording artist, as well as a television and social media personality. Born and raised in the Bronx borough of New York City, she first received public attention through Instagram and became an internet celebrity. She continued to gain more recognition in 2015, after becoming a regular cast member of the VH1 reality television series Love & Hip Hop: New York. In February 2017, Cardi B signed her first solo record deal with Atlantic Records. <a href=\"https://www.last.fm/music/Cardi+B\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/7f2da8c1c5a0699845c91d964e1c2eca/250x250-000000-80-0-0.jpg', NULL),
(9171698, 'Putting It Together Orchestra', NULL, '', 'https://cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(10031656, 'Sløtface', 'Sløtface are an indie-rock band from Stavanger, Norway. They changed their name from Slutface in March 2016 to avoid online censorship. <a href=\"https://www.last.fm/music/Sl%C3%B8tface\">Read more on Last.fm</a>', '', 'https://e-cdns-images.dzcdn.net/images/artist/01879bf08c4fa8175d15e4dc88944974/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(10580067, 'Rels B', ' <a href=\"https://www.last.fm/music/Rels+B\">Read more on Last.fm</a>', 'QM', 'https://e-cdns-images.dzcdn.net/images/artist/8fd2490e2612a5ca852d3026b58465fa/250x250-000000-80-0-0.jpg', NULL),
(10639133, 'The Kira Justice', 'Já se imaginou indo a um show de rock para curtir músicas de sucessos da TV que fizeram a sua infância, como a abertura de desenhos como Pokémon e Simpsons, ou a Marcha Imperial de Star Wars? Pois a banda The Kira Justice, além de tocar algumas destas canções tema, escreve músicas inspiradas neste universo.\n\nA banda surgiu no ano de 2007, em Porto Alegre, Rio Grande do Sul. O quarteto é composto pelo baterista Rafa, a baixista Alice, e os irmãos Matheus e Sarisa nos vocais. <a href=\"https://www.last.fm/music/The+Kira+Justice\">Read more on Last.fm</a>', 'QZ', 'https://e-cdns-images.dzcdn.net/images/artist/5bc9bca5078dee6f0e52d9d03ee8d879/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(11056858, 'Smash Bros', ' <a href=\"https://www.last.fm/music/Smash+Bros\">Read more on Last.fm</a>', '', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(13512345, 'The Black Aces Of Soul And The Eyes Of Ebony', ' <a href=\"https://www.last.fm/music/+noredirect/The+Black+Aces+of+Soul+and+the+Eyes+of+Ebony\">Read more on Last.fm</a>', '', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(13660651, 'Pokémon Theme', ' <a href=\"https://www.last.fm/music/+noredirect/Pok%C3%A9mon+Theme\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(14019981, 'MATRANG', 'Matrang — 22-летний Алан Хадзарагов. Он родился во Владикавказе, но уже долгое время живет на два города. В декабре 2017-го его подписал “Газгольдер”. Трансфер произошел уже после того, как песни Алана начали мелькать в больших пабликах, а сам он собрал на концерте в родном городе 500 человек.  <a href=\"https://www.last.fm/music/MATRANG\">Read more on Last.fm</a>', 'RU', 'https://e-cdns-images.dzcdn.net/images/artist/a4e66aa3b4e935d0c374593843da985a/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(14169283, 'Georg Ramos featuring Marisson Ramos & Wedson Marc', NULL, '', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(14277155, 'Yoshi Flower', 'Joshua Flower  (born October 12th, 1994), known professionally as Yoshi Flower, is an American singer, songwriter, and producer signed to Interscope Records. The Detroit born musician independently released his debut track \"Movies\" on March 9th, 2018 with The Fader calling the song \"early Lana Del Rey except if her partying involved EDM.\" The singer released his debut mixtape \"American Raver\" on October 12th, 2018 with ID Magazine summarizing it as a \"pledge of allegiance gone goth. <a href=\"https://www.last.fm/music/Yoshi+Flower\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/6ae0c833874977ab603834489e229254/250x250-000000-80-0-0.jpg', 'cedric.rotondo@gmail.com'),
(14456487, 'Juice Wrld', '\nJared Higgins (born December 2, 1998), known professionally as Juice WRLD, is an American rapper from Calumet Park, Illinois. He is primarily known for his breakout hits, \"All Girls Are The Same\" and \"Lucid Dreams\", the latter of which peaked at #2 on the Billboard Hot 100. His music has been described as \"emo-leaning and genre-bending\". He released his debut studio album \"Goodbye & Good Riddance\" in May 2018. It has since peaked at #4 on the Billboard 200. <a href=\"https://www.last.fm/music/Juice+WRLD\">Read more on Last.fm</a>', 'US', 'https://e-cdns-images.dzcdn.net/images/artist/32458864045f1087652738e10bcdf74b/250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com'),
(14919017, 'Oceans Collide', ' <a href=\"https://www.last.fm/music/Oceans+Collide\">Read more on Last.fm</a>', 'FR', 'https://e-cdns-images.dzcdn.net/images/artist//250x250-000000-80-0-0.jpg', 'vieflorian@gmail.com');
